import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { SampleBase } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar, Ribbon } from '@syncfusion/ej2-react-documenteditor';
import { TitleBar } from './title-bar';
import './default.component.css';
import { SwitchComponent } from '@syncfusion/ej2-react-buttons';
DocumentEditorContainerComponent.Inject(Toolbar,Ribbon);

// tslint:disable:max-line-length
export class WebLayout extends SampleBase<{}, {}> {
    private hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    public container: DocumentEditorContainerComponent;
    public titleBar: TitleBar;
    public rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        this.container.documentEditor.pageOutline = '#E0E0E0';
        this.container.documentEditor.acceptTab = true;
        this.container.documentEditor.resize();
        this.titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), this.container.documentEditor, true);
        this.onLoadDefault();
        this.titleBar.showButtons(false);
    }
    render() {
        return (<div className='control-pane'>
            <div className='control-section'>
                <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
                <div id="documenteditor_container_body">
                    <DocumentEditorContainerComponent id="container" ref={(scope) => { this.container = scope; }} style={{ 'display': 'block' }}
                       height={'590px'} toolbarMode={'Ribbon'} serviceUrl={this.hostUrl} enableToolbar={true} locale='en-US'  layoutType={"Continuous"} />
                </div>
            </div>
            <div id="action-description">
                <p>This example explains about the continuous layout type to display the document in a single page.</p>
            </div>
            <div id="description">
                <p>In this example, you can view the documents in single page using the Continuous layout type.</p>
                <p>Supported layout types: </p>
                <ul>
                        <li>Pages.</li>
                        <li>Continuous.</li>
                    </ul>
                <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/how-to/change-document-view/">documentation section.</a>
                </p>
            </div>
        </div>);
    }
    onLoadDefault = (): void => {
        // tslint:disable
        let defaultDocument: Object = {"sfdt":""};
        // tslint:enable        
        this.container.documentEditor.open(JSON.stringify(defaultDocument));
        this.container.documentEditor.documentName = 'Web Layout';
        this.titleBar.updateDocumentTitle();
        this.container.documentEditor.documentEditorSettings.showRuler = true;
        this.container.documentChange = (): void => {
        this.titleBar.updateDocumentTitle();
        this.container.documentEditor.focusIn();
        };
    }

    change = (args):void=>{
        if (args.checked) {
            this.container.toolbarMode = 'Ribbon';
        }
        else {
            this.container.toolbarMode = 'Toolbar';
        }
        this.titleBar.showButtons(this.container.toolbarMode != 'Ribbon')
    }
}